import React, { Component } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import AddKyc from "./add_kyc";
import ViewKyc from "./view_kyc";
import ModifyKyc from "./modify_kyc";
import Navbar from "../navbar/Navbar";

class BankHome extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <Router>
          <Routes>
            <Route exact path="/addkyc" element={<AddKyc />}></Route>
            <Route exact path="/viewkyc" element={<ViewKyc />}></Route>
            <Route exact path="/modifykyc" element={<ModifyKyc />}></Route>
          </Routes>
        </Router>
      </div>
    );
  }
}

export default BankHome;
